import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/js/bootstrap.min.js';
import { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import AgoraRTC from "agora-rtc-sdk";
import { AGORA_APP_ID } from "../agora.config";
import http from '../http'
export const VideoCallPage = () => {  
     const navigate = useNavigate();
     const {id} = useParams(); 
      
      const[allchatusers, setChatusers] = useState([]);
         useEffect(()=>{
            fetchAllUsers();
         },[]);

      const fetchAllUsers = () => {
            const tokenString = sessionStorage.getItem('token');
           // const userToken = JSON.stringify(tokenString);
            //console.log(userToken);
            if(tokenString === null){
               alert('Please Login!')
               navigate('/Login');
            }
   
         http.get('/userdetails/'+id).then(res=>{
           try{
            //setChatusers(res.data);
              console.log(res.data);
              const rtc = [];
              const name = "DemoChannel";
               rtc.client = AgoraRTC.createClient({ mode: "rtc", codec: "h264" });
               rtc.client.on("user-published", async (user, mediaType) => {
               console.log('published');
               })
            }catch(e){
              console.log('error', e);        
            }
   
         })
   
        } 
        
        const initClientEvents = () => {
         const rtc = [];
         rtc.current.client.on("user-published", async (user, mediaType) => {
           // New User Enters
           await rtc.current.client.subscribe(user, mediaType);
           if (mediaType === "video") {
             const remoteVideoTrack = user.videoTrack;
             setUsers((prevUsers) => {
               return [...prevUsers, { uid: user.uid, audio: user.hasAudio, video: user.hasVideo, client: false, videoTrack: remoteVideoTrack }]
             })
           }
     
           if (mediaType === "audio") {
             const remoteAudioTrack = user.audioTrack;
             remoteAudioTrack.play();
             setUsers((prevUsers) => {
               return (prevUsers.map((User) => {
                 if (User.uid === user.uid) {
                   return { ...User, audio: user.hasAudio }
                 }
                 return User
               }))
             })
           }
         });
     
         // rtc.current.client.on("user-unpublished", (user, type) => {
         //   //User Leaves
         //   if (type === 'audio') {
         //     setUsers(prevUsers => {
         //       return (prevUsers.map((User) => {
         //         if (User.uid === user.uid) {
         //           return { ...User, audio: !User.audio }
         //         }
         //         return User
         //       }))
         //     })
         //   }
         //   if (type === 'video') {
         //     setUsers((prevUsers) => {
         //       return prevUsers.filter(User => User.uid !== user.uid)
         //     })
         //   }
         // });
       }
return (
